import numpy as np


def data_count(bw_text):
    last_col = [(bw_text[i], i) for i in range(len(bw_text))]
    first_col = sorted(last_col)
    count = {k: np.zeros(len(bw_text) + 1, dtype=int) for k in sorted(set(bw_text))}
    first_occurrence = {k: 0 for k in count}

    for i, s in enumerate(bw_text):
        count[s][i + 1:] += 1

    for i, pair in enumerate(first_col):
        if first_occurrence[pair[0]] == 0:
            first_occurrence[pair[0]] = i

    return first_occurrence, last_col, count


def burrows_wheeler_matching_count(last_column, first_occurrence, pattern, count):
    top = 0
    bottom = len(last_column) - 1
    while top <= bottom:
        # print(top, bottom)

        if pattern:
            symbol = pattern[-1]
            pattern = pattern[:-1]
            if symbol in [x[0] for x in last_column[top:bottom + 1]]:
                top = first_occurrence[symbol] + count[symbol][top]
                bottom = first_occurrence[symbol] + count[symbol][bottom + 1] - 1
            else:
                return 0
        else:
            return bottom - top + 1


def solve_burrows_wheeler_matching_count(string, patterns):
    first_occurrence, last_column, count_s = data_count(string)
    count = []
    for pattern in patterns.split():
        count.append(burrows_wheeler_matching_count(last_column, first_occurrence, pattern, count_s))

    return count


